  <style>
    * {
      box-sizing: border-box;
    }

    body {
      margin: 0;
      font-family: Arial;
      font-size: 17px;
    }

    #myVideoOld {
      position: fixed;
      right: 0;
      bottom: 0;
      min-width: 100%; 
      max-height: 100%;
    }

    #loopVideo11 {
      position: fixed;
      top: 0;
      /*right: 0;*/
      bottom: 0;
      left: -30%;
      height: 100%;
      min-width: 100%;
    }

    .content {
      position: fixed;
      bottom: 0;
      background: rgba(0, 0, 0, 0.5);
      color: #f1f1f1;
      width: 100%;
      padding: 20px;
    }

    .allscreen {
      position: absolute;
      top: 0;
      right: 0;
      bottom: 0;
      left: 0;
      height: 100%;
      width: 100%;
    }

    #Packshot {
      width: 100%;
      height: 100%;
      object-fit: cover;
      object-position: 50% 60%;
      opacity: 0;
    }

    #allscreenBtn {
      width: 100%;
      height: 100%;
      font-size: 18px;
      padding: 10px;
      border: none;
      background: rgba(0, 0, 0, 0);
      color: rgba(0, 0, 0, 0);
      cursor: pointer;
    }

    #JoystickBack {
      position: fixed;
      width: 20%;
      bottom: 12%;
      left: 41%;
      opacity: 0;
    }

    #JoystickCenter {
      position: fixed;
      opacity: 0;
    }

    #TutorHand {
      position: fixed;
      opacity: 0;
    }

    #CtaLogo {
      position: fixed;
      width: 12%;
      bottom: 2%;
      left: 3%;
    }

    #CtaDownload {
      position: fixed;
      width: 12%;
      bottom: 2%;
      right: 3%;
    }

    #CtaDownloadButton {
      position: fixed;
      appearance: none;
      border: none;
      background: rgba(0, 0, 0, 0);
      color: rgba(0, 0, 0, 0);
      cursor: pointer;
    }

    #CoinCounter {
      position: fixed;
      width: 30%;
      top: 2%;
      right: 5%;
    }

    #LoadingBack {
      position: absolute;
      top: 0;
      right: 0;
      bottom: 0;
      left: 0;
      height: 100%;
      min-width: 100%;
      z-index: 100;
    }

    #LoadingLogo {
      position: fixed;
      width: 30%;
      bottom: 45%;
      left: 35%;
      z-index: 101;
    }

    window.gameReady && window.gameReady();

    const video = document.getElementById("loopVideo");

    const packshot = document.getElementById("Packshot");

    loadingLogo.src = logo.src;

    let cTweenCenter;
    let cTweenHand;

    const isClickCount = false;
    const clickCountToStore = 1;

    const joystickCenterWidthL = 4;

    const tutorHandWidthP = 14;
    const tutorHandWidthL = 10;
    const tutorHandAnchorX = 0.4;
    const tutorHandAnchorY = 0.95;

    let bounceTime = 0;
    const bouncePeriod = 1000;
    const bounceMagP = 2;
    const bounceMagL = 1;
    const bounceUpdateInterval = 20;

    // logo button

    const logoWidthL = 12;
    const logoLeftL = 1.5;
    const logoBottomL = 2;

    const logoWidthPackL = 32;

    // download

    const downloadBottomL = 2;

    const downloadWidthPackL = 26;
    const downloadRightPackL = 5;

    //--------

    let isFail = false;
    let isInFailAnimation = false;

    video.addEventListener('play', () => {
      audio.play();
    });

    const setSpritePos = (el, posX, posY, anchorX, anchorY) => {
      const width = Number(el.style.width.split('%')[0]);
      // const height = Number(el.style.height.split('%')[0]);
      const height = Math.round(el.height / window.innerHeight * 100);
      // console.log(el.height);
      const left = (posX - width * anchorX) + '%';
      const bottom = (posY - height * anchorY) + '%';

      el.style.left = left;
      el.style.bottom = bottom;
    }

    const getSpriteHeight = (el) => {
      return Math.round(el.height / window.innerHeight * 100);
    }

    const b64toBlob = (b64Data, contentType='', sliceSize=512) => {
      const byteCharacters = atob(b64Data);
      const byteArrays = [];

      for (let offset = 0; offset < byteCharacters.length; offset += sliceSize) {
        const slice = byteCharacters.slice(offset, offset + sliceSize);

        const byteNumbers = new Array(slice.length);
        for (let i = 0; i < slice.length; i++) {
          byteNumbers[i] = slice.charCodeAt(i);
        }

        const byteArray = new Uint8Array(byteNumbers);
        byteArrays.push(byteArray);
      }
        
      const blob = new Blob(byteArrays, {type: contentType});

    function pingPongElPosition(el, anchorX, anchorY, startPos, endPos, cPos, totalTime, timeLeft, currTime, direction, tween) {
      if (!tween) {
        tween = {isContinue: true};
      }

      const timeDelta = performance.now() - currTime;

      const velX = direction > 0? (endPos.x - cPos.x) / timeLeft: (startPos.x - cPos.x) / timeLeft;
      const velY = direction > 0? (endPos.y - cPos.y) / timeLeft: (startPos.y - cPos.y) / timeLeft;

      cPos.x += velX * timeDelta;
      cPos.y += velY * timeDelta;

      setSpritePos(el, cPos.x, cPos.y, anchorX, anchorY);

      timeLeft -= timeDelta;
      currTime = performance.now();

      if (tween.isContinue) {
        if (timeLeft > 0) {
          setTimeout(() => pingPongElPosition(el, anchorX, anchorY, startPos, endPos, cPos, totalTime, timeLeft, currTime, direction, tween), 17);
        } else {
          if (direction > 0) {
            cPos.x = endPos.x;
            cPos.y = endPos.y;
            direction = -1;
          } else {
            cPos.x = startPos.x;
            cPos.y = startPos.y;
            direction = 1;
          }
          timeLeft = totalTime;
          setTimeout(() => pingPongElPosition(el, anchorX, anchorY, startPos, endPos, cPos, totalTime, timeLeft, currTime, direction, tween), 17);
        }
      }
      
      return tween;
    }

      AdRedirectProcessing(storeLink);
    }

    function openStoreUrl(url){if(url){if(typeof mraid !== "undefined"){mraid.open(url)}else{window.open(url)}}}function mraidIsReady(){if(mraid.isViewable()){mraid.removeEventListener("ready",mraidIsReady);showMyAd()}else{mraid.addEventListener("viewableChange",mraidIsViewable)}}function mraidIsViewable(isViewable){if(isViewable){video.play();audio.play()}else{video.pause();audio.pause()}}function showMyAd(){video.play();audio.play()}function doReadyCheck(){if(typeof mraid!=="undefined"&&mraid.getState()=="loading"){mraid.addEventListener("ready",mraidIsReady)}else{showMyAd()}}

    function AdRedirectProcessing(url) {
      openStoreUrl(url);
    }

    doReadyCheck();
    mraid.addEventListener('audioVolumeChange', mraidHandleVolumeChange);	

    function mraidHandleVolumeChange( volumePercentage ) {
      volumePercentage = volumePercentage / 100;
      audio.volume = Math.max(0, Math.min(1, volumePercentage));
		}

  </script>
</body>
</html>
